import React from 'react'
import SecteurSelector from './SecteurSelector'
import CooperativesList from './CooperativesList'

class COPInterface extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      currentSecteur: props.defaultSecteur
    }
    this.onSelectedSecteurChange = this.onSelectedSecteurChange.bind(this)
  }

  onSelectedSecteurChange(currentSecteur){
    this.setState({currentSecteur})
    this.props.onSelectedSecteurChange(currentSecteur)
  }

  render(){
      return <div>
        <SecteurSelector 
          coopData = {this.props.coopData} 
          currentSecteur = {this.state.currentSecteur}
          onSelectedCooperativeChange = {this.props.onSelectedCooperativeChange}
          onSelectedSecteurChange = {this.onSelectedSecteurChange}/>
        <CooperativesList 
          flyToCooperative = {this.props.flyToCooperative}
          coopData = {this.props.coopData} 
          currentSecteur = {this.state.currentSecteur}
          onHoveredCooperativeChange = {this.props.onHoveredCooperativeChange}
          onSelectedCooperativeChange = {this.props.onSelectedCooperativeChange}/>
      </div>
  }
}

export default COPInterface
